import UserItem from '../UserItem/UserItem';

const UserList = (props) => {

    const onClickDelete = () => {
        props.onDeleteItem()
    }

    const users = props.users;
    return (
      <div>
          <ul>
              {users.map( user => 
                  (<UserItem
                    key={user.id}
                    id={user.id}
                    onDeleteItem={props.onDeleteItem}>
                    {user.name + ' ' + user.age}
                    </UserItem>)
              )}
          </ul>
      </div>  
    );
};

export default UserList;
